import React from 'react';
import {useSelector} from "react-redux";
import { useHistory} from "react-router";

export const Home = () => {
    const isAuth = useSelector(state => state.user.isAuth);
    const history = useHistory();
    if (!isAuth){
        history.push('/login')
    }
    return (
        <div>
            <h1>Вы зарегестрированы</h1>
        </div>
    );
};
